import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  footer: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: "#FAFAFA",
    paddingTop: 5,
    paddingHorizontal: 15,
    shadowColor: "#212121",
    shadowOpacity: 0.2,
    height: 4,

  },
    casa: {
    borderRadius: 0,
    width: 50,
    height: 50,
    marginBottom: 7,
  },
  viewFooter: {
    alignItems: "center",
  },
  imageExtratoFooter: {
    borderRadius: 8,
    width: 25,
    height: 25,
    marginBottom: 5,
  },
  imagesFooter: {
    borderRadius: 30,
    width: 30,
    height: 30,
    marginBottom: 5,
  },
});
